Let's think step by step. We start by calculating the square of 3.6: $$(3.6)^2=12.96.$$Then, since $\lceil x\rceil$ denotes the least integer greater than or equal to $x$, we have $$\begin{align*}
\lceil (3.6)^2 \rceil&=\lceil 12.96\rceil\\
&=13.
\end{align*}$$Next, we evaluate $\lceil 3.$ Again, we use the definition of the ceiling function: $$\begin{align*}
\lceil 3.&amp;=\lceil 3.000000\dots\\
&amp;=4
\end{align*}$$Substituting our answers into the original problem, we get: $$\begin{align*}
\lceil (3.6)^2 \rceil - (\lceil 3)&amp;=13-(4)\\
&amp;=\boxed{9}.
\end{align*}$$The answer is: 9.

